Modifier* get_modifier(ModifierSource source, int index) {
    switch(source) {
        case SOURCE_NORMAL:
            return (index < MODIFIERS_NORMAL_COUNT) ? &MODIFIERS_NORMAL[index] : NULL;
        case SOURCE_DESECRATED:
            return (index < MODIFIERS_DESECRATED_COUNT) ? &MODIFIERS_DESECRATED[index] : NULL;
        case SOURCE_ESSENCE:
            return (index < MODIFIERS_ESSENCE_COUNT) ? &MODIFIERS_ESSENCE[index] : NULL;
        case SOURCE_PERFECT_ESSENCE:
            return (index < MODIFIERS_PERFECT_ESSENCE_COUNT) ? &MODIFIERS_PERFECT_ESSENCE[index] : NULL;
        default:
            return NULL;
    }
}
